import React, { useEffect, useState } from 'react'
import { Link,useParams } from 'react-router-dom'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {faPlus,faArrowLeft} from '@fortawesome/free-solid-svg-icons'
import Header from '../components/Header'
import axios from 'axios'


function Participant() {
  const [data,setData] = useState([]);
  const [participant,setParticipant] = useState([]);
  const {id} = useParams();


  useEffect(()=>{
    const fetchData = async ()=>{
      try {

        const res = await axios.get("http://localhost:5000/show/"+id)
        // console.log(res.data)
        setData(res.data)
        
      } catch (error) {
        console.log(error);
      }

      try {

        const res = await axios.get("http://localhost:5000/participant/projet/"+id)
        // console.log(res.data)
        setParticipant(res.data)
        
      } catch (error) {
        console.log(error)
      }
    }
    
    fetchData();
  },[])


  const handleClick = async (e) => {
    e.preventDefault();
    try {
      await axios.delete("http://localhost:5000/deleteParticipant/"+id)
      navigate("..");
    } catch (error) {
      console.log(error);
    }
  }

  return (
    <div className='container'>
      <Header />
      <Link to={"/"} className='btn btn-primary btn-sm '><FontAwesomeIcon icon={faArrowLeft} /> Retour</Link>
      <Link to={"/addProf/"+id} className='btn btn-success btn-sm mx-2'><FontAwesomeIcon icon={faPlus} /> Ajouter un nouveau</Link>
      <h3 className='my-3'>A propos de Formation :</h3>
      <hr />
      {
        data.map(item=>(
          <div>
             <div className='row'>
                <div className="col"><p><strong>Nom Projet</strong>: {item.nom_projet} </p> </div>
                <div className="col"><p><strong>Axe</strong> : {item.nom_axe}</p></div>
              </div>
              <div className="row">
                <div className="col"><p><strong>Etablissement</strong> : {item.nom_etab}</p></div>
                <div className="col"><p><strong>Module</strong> : {item.module}</p></div>
              </div>
          </div>
         
         
        ))
      }

      <h3 className='my-3'>List des Participants :</h3>
      <hr />
              <table className="table table table-striped table-hove " >
                  <thead>
                    <th>PPR</th>
                    <th>Nom Professeur</th>
                    <th>Nom Etablissement</th>
                    <th>Actions</th>
                  </thead>
                  <tbody>
                    {
                      participant.map(item =>(
                        <tr>
                          <td>{item.ppr}</td>
                          <td>{item.nom_pr}</td>
                          <td>{item.nom_etab}</td>
                          <td>
                            <Link to={"/updateParticipant/"+item.participant_id} className='btn btn-sm btn-success'>Modifier</Link>
                            <Link to={"/DeleteParticipant/"+item.participant_id} className='btn btn-sm btn-danger mx-2' onClick={handleClick}>Supprimer</Link>
                            </td>
                        </tr>
                      ))
                    }
                  </tbody>
              </table>
    </div>
  )
}

export default Participant
